  function createSeededRandom(seed) {
    let state = seed;

    return function () {
      // LCG clásico: state = (a * state + c) % m
      state = (1664525 * state + 1013904223) % 2 ** 32;
      return state / 2 ** 32; // devuelve número entre 0 y 1
    };
  }


